  const sink = document.querySelectorAll("#sink");
  const sinkStand = document.querySelectorAll("#sink-stand");
  const bath = document.querySelectorAll("#bath");
  const window = document.querySelectorAll("#window");
  const bathBtn = document.querySelectorAll("#bath-button");
  const sinkBtn = document.querySelectorAll("#sink-button");
  const shelfBtn = document.querySelectorAll("#shelf-button");
  const sinkDetails = document.querySelectorAll("#sink-details");
  const bathDetails = document.querySelectorAll("#bath-details");
  const shelfDetails = document.querySelectorAll("#shelf-details");

